// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Funder {
     struct user{
        string username;
        string email;
        string password;
     }

     user[] public users;
      uint public usersCount=0;
      
    
    function getUser(string memory em, string memory pass)public view returns(bool){
      uint p =usersCount;
        uint i=0;
        while(i<usersCount){
          string memory curr=users[i].email;
          if(bytes(curr).length == bytes(em).length && 
          keccak256(abi.encodePacked(curr)) == keccak256(abi.encodePacked(em))){    p=i;
             
            break;
            }
          
            i++;
        }
       
        if(p!=usersCount){
         string memory pss=users[p].password;          
            if(bytes(pass).length == bytes(pss).length && 
          keccak256(abi.encodePacked(pass)) == keccak256(abi.encodePacked(pss)))return true;
        }
        else return false;
    }
      

    function createUser(string memory _username,string memory _email,string memory password) public  {
        user memory newUser = user({
         email:_email,
         username:_username,
         password:password
      });
       usersCount++;
      users.push(newUser);
    }
/// contribution/////
    struct contribution {
      address useraddress;
      string username;
      string email;
      uint amount;
    }

    uint256 public numOfFunders=0;
    address public owner;
    uint public targetToAchieve;
    address[] public contributers;
    
    constructor(){
        owner=msg.sender;
    }

    // mapping(uint256 => address) private funders;
    

   function getOwner() public view returns(address) {    
        return owner;
    }
    
function transfer() external payable {
       numOfFunders+=1;
    }
       function contibute() public payable {
      require(msg.value > 2 );

      contributers.push(msg.sender);
    //   approvers[msg.sender] = true;
    //   approversCount++;
  }


    function withdraw(uint256 withdrawAmount) external {
        require(
            withdrawAmount <= 2000000000000000000 && msg.sender==owner,
            "Cannot withdraw more than 2 ether"
        );
        payable(msg.sender).transfer(withdrawAmount);
    }
}
